interface CachedLookup {
  [key: string]: {
    id: string;
    name: string;
  };
}

interface MergeData extends NomicCryptoDetail, CoingeckoMarketDetail {}

const CACHE = JSON.parse(jsonMapCache) as CachedLookup;

const handler = async (req: NextApiRequest, res: NextApiResponse<MergeData>): Promise<void> => {
  const { key, marketDuration = 1 } = req.query;
  const cryptoName = key as string;

  try {
    const [nomicMetadata, coingecko] = await Promise.all<
      NomicCryptoDetail[],
      CoingeckoMarketDetail
    >([
      fetch(
        `https://api.nomics.com/v1/currencies?key=${
          process.env.NOMICS_KEY
        }&ids=${cryptoName.toUpperCase()}&attributes=id,name,description,website_url`,
      ).then(res => res.json()),
      fetch(
        `https://api.coingecko.com/api/v3/coins/${CACHE[cryptoName].id}/market_chart?&vs_currency=gbp&days=${marketDuration}`,
      ).then(res => res.json()),
    ]);

    const data = { ...nomicMetadata[0], ...coingecko };
    res.statusCode = 200;
    res.json(data);
  } catch (error) {
    res.statusCode = 500;
    res.json(null);
  }
};

export default handler;
